import React, { Component } from "react";
 
class Contact extends Component {
  render() {
    return (
        "contact":{
            "header":"Contact",
            "mailAddress":"your mail",
            "message":"your message",
            "sendMessage":"Mail send",
            "sendButton":"Send message"
          }
    );
  }
}
 
export default Contact;
